import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { Container, Header } from "native-base";
import { Col, Row, Grid } from "react-native-easy-grid";

export default function App() {
  return (
    <Container>
      <Header />
      <Grid>
        <Row>
          <Col style={{ backgroundColor: "#632OA7", height: 300 }}></Col>
          <Col style={{ backgroundColor: "#10CE9F", height: 300 }}></Col>
        </Row>
        <Row>
          <Col style={{ backgroundColor: "#cdcdcd", height: 300 }}></Col>
          <Col style={{ backgroundColor: "#000", height: 300 }}></Col>
        </Row>
      </Grid>
    </Container>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    backgroundColor: "#000",
    alignItems: "center",
    justifyContent: "center",
  },
});
